  "feature": ["<p>Added <code>showSorterTooltip</code> to the <code>Table</code> component, and fixed the style problem of the sort arrow being covered by the background color.</p>\n", "<p>The <code>Table</code> component adds <code>expandProps.expandRowByClick</code>, which supports click row expansion.</p>\n", "<p>The <code>onChange</code> parameter of the <code>Table</code> component adds a fourth parameter <code>extra</code>, and the current trigger action can be obtained through <code>extra.action</code>.</p>\n", "<p>Added <code>rowSelection.renderCell</code> to the <code>Table</code> component, which supports custom checkboxes.</p>\n", "<p>The <code>Table</code> component adds <code>rowSelection.preserveSelectedRowKeys</code>, which supports retaining the <code>key</code> value in <code>selectedRowKeys</code> after the data item is deleted.</p>\n"]
