  "bugfix": ["<p>Fix the bug that the pop-up cannot be displayed when the pre-operation column of the <code>Table</code> component is wrapped with <code>Tooltip</code>.</p>\n", "<p>Fix the bug that the <code>column.width</code> of the <code>Table</code> component is not valid for <code>string</code>.</p>\n"],
